import ACTION_TYPE from "./actionTypes";

export function incrementActionCreator(){
    return {type: ACTION_TYPE.SET}
}

export function setValueActionCreator(value){
    return {type: ACTION_TYPE.SET, payload: value}
}

export function complicatedActionCreator(musicBand, author, todoItemId){
    return {type: 'fdgdg', payload: {event: musicBand.event.target, id:todoItemId, author} }
}
